import ReactDOM from "react-dom";
import '../src/index.css';

function Card(props){
  console.log(props);
  return(
    <>
     <div className="cards">
    <div className="Header">
      <h1>A Netflix Original Series</h1>

    </div>
    <div className="card1">
      <img src={props.imgsrc}/>
      <span>{props.title}</span>
      <h1>{props.sname}</h1>
      <a href={props.link}>
        <button>Click Here to Watch</button>
      </a>

    </div>

  </div>
    </>
  )
}

